FIGURE 1  Synthesis and chemical structures of mELP and Bio-IL.
(a) Schematic representation of the chemical structures of ELP and mELP;
(b) ¹H NMR spectra of ELP and mELP;
(c) hydrophobic pockets in ELP structure from amino acid residues having hydrophobic residues;
(d) synthesis of Bio-IL from choline bicarbonate and acrylic acid conjugation reaction and corresponding ¹H NMR spectrum.
DPBS, Dulbecco’s phosphate-buffered saline; ¹H NMR, proton nuclear magnetic resonance; Bio-IL, acrylated choline-based bioionic liquid; ELP, elastin-like polypeptide; mELP, methacrylated ELP.

Proton peaks for mELP with both low and high DM (Figures 1b and S1; highlighted in yellow) in the region of 5.5 to 6.3 ppm. In addition, the presence of distinct ELP peaks (Figure 1b and S1; highlighted in green), within the region of 7.5–8.3, before and after methacrylation confirmed its structural stability during the reaction. For quantitative analysis of the DM, an aromatic peak at 7.5 ppm related to Trp (W) residue was used as a reference, and DM was calculated to be approximately 18% for the low methacrylated ELP and 33% for the high methacrylated ELP based on Equation (1). Meanwhile, ELP macromolecules with hydrophobic side chains (([VPGVG]₄[IPGVG])₁₄) could readily form hydrophobic pockets to avoid interactions with water molecules (Figure 1c). Such structural alterations induced by hydrophobic interactions are well-established and have been shown to provide thermodynamic stability to the polymer in solution.⁵⁴ On the other hand, Bio-IL was synthesized through the reaction of acrylic acid and choline-based bicarbonate. The ¹H NMR spectra of the acrylated Bio-IL showed the characteristic multiple peaks in the range of 5.3–6.3 ppm, confirming the acrylation of Bio-IL (Figure 1d, highlighted in yellow). Also, the appearance of a sharp peak at δ ~ 3.1 ppm corresponds to the three hydrogen atoms of the ammonium ion (Figure 1d, highlighted in green).

Different concentrations of Bio-IL (7%, 11%, and 15% (v/v)) were mixed with a 15% (w/v) mELP solution and photocrosslinked in the presence of Irgacure 2959 to engineer an elastic and conductive hydrogel for reconnection of injured nerve tissues (Figure 2a).
